    font-family: "SansReg";
    font-size: 16px;
    color: hsl(0, 0%, 100%);
    background-color: rgba(64, 224, 208, 0.8); /* Turquoise background */
    border: none;
    border-radius: 10px;
    padding: 10px 20px;
    cursor: pointer;
    margin: 0 auto; /* Center the button horizontally */
    margin-top: auto; /* Push the button to the bottom */
    transition: background-color 0.3s ease, transform 0.2s ease;
